import React from "react";
import { Button, ButtonGroup } from "reactstrap";

const Linksr1 = props => {
  return (
    <Button size="lg" color="info" className="p-3">
      <img src={props.image}></img>
      <p>{props.text}</p>
    </Button>
  );
};

export default Linksr1;
